description:
In Command
~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~

Synopsis: When Regina, who is a tad clumsy and old fashioned applies for a job as governess... She is hosted coldly by Melissa, the nymphomaniac stewardess who Horst, the owner, allegedly nailed in a wheelchair. Melissa multiplies the sexual adventures with the males of her circle, without disregarding the lesbian caresses. But she is worried about the attention that Horst gives her new home nurse. Indeed. Regina soon acquires a devastating sex appeal and used her charms to seduce her boss changing herself into and enticing nurse, a mischievous schoolgirl or and SM mistress...

Cast: Melissa Lauren, Natalli Di Angelo, Regina Ice, Stella Delcroix, Sofia Valentine, Nacho Vidal, Horst Baron, Tony Del Duomo,Director

